import React from "react";
import axios from "axios";

class AdminDashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [],
      courses: [],
      syllabus: [],
      books: [],
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:8000/users")
      .then((response) => {
        this.setState({ users: response.data });
      })
      .catch((error) => {
        console.log("Error fetching users:", error);
      });

    axios
      .get("http://localhost:8000/courses")
      .then((response) => {
        this.setState({ courses: response.data });
      })
      .catch((error) => {
        console.log("Error fetching courses:", error);
      });

    axios
      .get("http://localhost:8000/syllabus")
      .then((response) => {
        this.setState({ courses: response.data });
      })
      .catch((error) => {
        console.log("Error fetching courses:", error);
      });
    axios
      .get("http://localhost:8000/books")
      .then((response) => {
        this.setState({ courses: response.data });
      })
      .catch((error) => {
        console.log("Error fetching courses:", error);
      });

    // Fetch data for other functionalities (e.g., syllabus, books)
  }

  render() {
    const { users, courses, syllabus, books } = this.state;

    return (
      <div>
        <h1>Admin Dashboard</h1>

        <h2>Users</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Email</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.email}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h2>Courses</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Course Name</th>
              <th>description</th>
            </tr>
          </thead>
          <tbody>
            {courses.map((courses) => (
              <tr key={courses.course_id}>
                <td>{courses.course_id}</td>
                <td>{courses.course_name}</td>
                <td>{courses.course_desc}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h2>books</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Book Name</th>
              <th>no of books</th>
            </tr>
          </thead>
          <tbody>
            {books.map((books) => (
              <tr key={books.id}>
                <td>{books.id}</td>
                <td>{books.books}</td>
                <td>{books.bookno}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h2>syllabus</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th> Name</th>
              <th>syllabus</th>
            </tr>
          </thead>
          <tbody>
            {syllabus.map((syllabus) => (
              <tr key={syllabus.int}>
                <td>{syllabus.int}</td>
                <td>{syllabus.course_name}</td>
                <td>{syllabus.syllabus}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Add sections for other functionalities (e.g., syllabus, books) */}
      </div>
    );
  }
}

export default AdminDashboard;
